import React from "react";
import { Menulist } from "./Menulist";
function NavBar  () {  
    
    const menulist = Menulist.map((data,index)=>{
        return(
            <ul className="textcolor">
               <li index={index}>
                   <a href={data.url}>{data.title}</a>
               </li>
           </ul>
        );
       
    })
  return (
    <div className="Container">
      <p>VPN LAB</p>
      {menulist}
    </div>
  );
}

 export default NavBar;
